import styled from 'styled-components';
import pokemon from '../../Pokemon.jpg'

export const Body = styled.div({
  background: `url(${pokemon}) no-repeat center`,
  backgroundSize: 'cover'
});

export const Image = styled.img({
  width: 300,
  height: 'auto'
})
